import Subject from '../Subject/Subject';
import styles from './Subjects.module.css';

function Subjects(props) {
    return (
        <div className={styles.subjects} id="subjectPage">
            <h2>SELECT A SUBJECT TO GET STARTED</h2>
            <Subject id="bio" name="Biology" onClick={() => props.changePage("bioPage")}/>
            <Subject id="psych" name="Psychology" onClick={() => props.changePage("psychPage")}/>
            <Subject id="phys" name="Physical Science" onClick={() => props.changePage("physPage")}/>
            <Subject id="his" name="History" onClick={() => props.changePage("hisPage")}/>
            <Subject id="lit" name="Literature" onClick={() => props.changePage("litPage")}/>
            <Subject id="cs" name="Computer Science" onClick={() => props.changePage("csPage")}/>
            <Subject id="math" name="Mathematics" onClick={() => props.changePage("mathPage")}/>
            <Subject id="soc" name="Social Sciences" onClick={() => props.changePage("socPage")}/>

        </div>
    );
}

export default Subjects;
